//www.transjournalists.org/>Trans Journalists Associatio</a>n and <a href=https://com.miami.edu/ >UMiami School of Communications</a>",da="Sorry, weâre having trouble loading the data. Please refresh your browser or try again later.",pa=[{name:"Trans Journalists Association",bio:"The <strong><a href=https://www.transjournalists.org/>Trans Journalists Association</a></strong> is a nonprofit professional membership organization that promotes accurate, nuanced coverage of trans issues and communities in the media and fosters the careers of gender-expansive journalists.",website:"https://www.transjournalists.org/",logoURL:"tja.png",social:[{platform:"BlueSky",platformURL:"https://bsky.app/profile/transjournalists.org"},{platform:"LinkedIn",platformURL:"https://www.linkedin.com/company/trans-journalists-association/"},{platform:"Instagram",platformURL:"https://www.instagram.com/transjournalists/"}]},{name:"The University of Miami School of Communication",bio:"Committed to developing forward-thinking, analytical, and ethical communication professionals, the <strong><a href=https://com.miami.edu/>University of Miami School of Communication</a></strong> (SoC) prepares students for success in a rapidly evolving global society. Our undergraduate and graduate programs integrate theory with practice, emphasizing creativity, collaboration, and independent thinking. Faculty at the SoC champion freedom of expression, guiding future scholars, professionals, and leaders toward a lifetime of service and learning.",website:"https://com.miami.edu/",logoURL:"um.png"},{name:"Polygraph",bio:"<strong><a href=https://polygraph.cool/ >Polygraph</a></strong> is a studio composed of the same team behind <a href=https://pudding.cool/  >The Pudding</a>. Theyâre an in-house data journalism team, with an eye for translating complex information into visual content.",website:"https://polygraph.cool/",logoURL:"polygraph.png"}],ga=[{name:"Treâvell Anderson",title:"Co-Director, Trans Journalists Association & Founder and Chief Imagination Officer, Slayzhon",bio:"Tre'vell Anderson is an award-winning journalist, noted podcast host, and authoress doing world-changing work around society and culture. Named to <a href=https://www.out.com/out100/disruptors/trevell-anderson>Out magazineâs 2023 list of the 100 most impactful LGBTQ+ people</a> and <a href=https://interactives.theroot.com/root-100-2020/tre-vell-anderson/>The Rootâs 2020 list of the 100 most influential African Americans</a>, they have dedicated their career to centering those in the margins, gray spaces, and at the intersections of life. Founder and Chief Imagination Officer of the social curation and media production house <a href=https://www.trevellanderson.com/slayzhon>Slayzhon</a>, Treâvell is also the authoress of âWe See Each Other: A Black, Trans Journey Through TV and Filmâ and co-authoress of the NAACP Image Award-winning <a href=https://www.historicallyblackphrases.com/>âHistorically Black Phrases</a>: From âI Ainât One Of Your Lilâ Friendsâ to âWho All Gonâ Be There?ââ"},{name:"Dr. Ayleen Cabas-Mijares",title:"Assistant Professor of Journalism, University of Miami",bio:"Dr. Ayleen Cabas-Mijares is an <a href=https://com.miami.edu/profile/ayleen-cabas-mijares/>assistant professor of journalism</a> at the University of Miami. Her scholarly work examines the impact of minoritized epistemologies and practices on journalism and media to evaluate how those influences could better support the liberatory potential of these institutions. She situates most of her research in the Latin American and Latinx contexts. Dr. Cabas-Mijares deploys qualitative methodologies in most of her studies and contributes to literature in critical/cultural studies, social movements studies, journalism studies, and transnational feminist and queer theories."},{name:"Dr. Alberto Cairo",title:"Knight Chair in Infographics and Data Visualization, School of Communication of the University of Miami",bio:"Dr. Alberto Cairo is the <a href=https://com.miami.edu/profile/alberto-cairo/>Knight Chair in Infographics and Data Visualization</a> at the <a href=https://com.miami.edu/>School of Communication of the University of Miami</a>. Heâs also the head of visualization at UMâs <a href=https://idsc.miami.edu/>Frost Institute for Data Science and Computing</a>. A renowned journalist and information designer, Cairo is also the author of four books, and a regular consultant with companies, governmental entities, and international organizations."},{name:"Gina Chua",title:"Board Member, Trans Journalists Association & Executive Editor, Semafor",bio:"Gina Chua is a <a href=https://www.transjournalists.org/>Trans Journalists Association</a> board member and executive editor at <a href=https://www.semafor.com/>Semafor</a>, a new global news startup. She joined it in May 2022 as part of the founding team led by Ben Smith and Justin Smith. Prior to joining Semafor, she was Executive Editor at Reuters, where she oversaw newsroom operations, logistics, budgets, safety and security, and worked with technology teams to develop newsroom tools, among other responsibilities. Gina was also the editor-in-chief of the South China Morning Post and The Asian Wall Street Journal in Hong Kong; a deputy managing editor at The Wall Street Journal in New York; a foreign correspondent in Singapore, Manila and Hanoi; and a television and radio journalist in Singapore. She co-founded the <a href=https://www.sigmaawards.org/>Sigma Data Journalism Awards</a> and was the inaugural recipient of the <a href=https://awards.journalists.org/entries/gina-chua/>Online News Associationâs Impact Award</a> for her dedication to innovation. Sheâs a regular speaker at journalism conferences and writes occasionally about the future of journalism and the intersection of the industry and technology on her blog."},{name:"Minami Funakoshi",title:"President, Trans Journalists Association & Graphics Journalist, Reuters",bio:"Minami Funakoshi is the president of the <a href=https://www.transjournalists.org/>Trans Journalists Association</a> and an award-winning nonbinary graphics journalist at <a href=https://www.reuters.com/>Reuters</a>. They make data-driven visual stories, develop tools, and do backend and frontend development. Their recent visual story on <a href=https://www.reuters.com/graphics/USA-HEALTHCARE/TRANS-BILLS/zgvorreyapd/>anti-trans bills in the United State</a> provides detailed analysis on the common methods used to restrict gender-affirming care for both adults and minors. Their interactive story on <a href=https://www.reuters.com/graphics/GENDER-LANGUAGE/LGBT/mopanqoelva/>gender-inclusive languages</a> won multiple awards, such as Gold from <a href=https://www.informationisbeautifulawards.com/>Information is Beautiful</a> and Silver from <a href=https://snd.org/>Society for News Design</a>."},{name:"Graph Massara",title:"Board Member, Trans Journalists Association & Copy Editor, Semafor",bio:"Graph Massara is a <a href=https://www.transjournalists.org/>Trans Journalists Association</a> board member, the editor of the <a href=https://styleguide.transjournalists.org/>TJA's stylebook</a>, and a copy editor at <a href=https://www.semafor.com/>Semafor</a>. He was recently a copy editor at HuffPost and a fact-checker with the Associated Press, where he also contributed to the AP Stylebook's entries on LGBTQ+ terminology. Prior to that, he was a newsletter editor at POLITICO. Graphâs professional interests include media criticism and ethics, the viral spread of mis- and disinformation, and online radicalization. He is an alum of UC Berkeley."},{name:"Kae Petrin",title:"Co-Director, Trans Journalists Association & Data & Graphics Reporter, Civic News",bio:"Kae Petrin is the co-director of the <a href=https://www.transjournalists.org/>Trans Journalists Association</a>. They co-founded the TJA in 2020 with several dozen other journalists and have since run many of the organizationâs internal operations. They currently work as a Data & Graphics Reporter on <a href=https://civicnews.org/>Civic News Company's</a> data visuals team, where they tell data-driven stories about K-12 education, voting rights, and public health. They have presented on queer and trans coverage best practices, data reporting and visualization tools, and the intersections of these topics for universities, industry conferences, custom-designed workshops, and newsrooms around the U.S."}],ma=[{type:"text",value:"The Trans News Initiative used <a href=https://search.mediacloud.org/>Media Cloud</a>, an open-source media research project, to gather the initial list of trans-related news articles. News articles were queried using a set of identity-related search terms from Media Cloudâs <a href=https://search.mediacloud.org/collections/34412234>âUnited States - Nationalâ collection</a> which includes over 240 sources. A team of journalists, researchers, and subject matter experts manually selected the initial eighth identity-related terms listed below. The terms are listed next to their exact queries, which account for different stylization, spellings and descriptors."},{type:"text",value:"The team used Python scripts to collect and process this data each week. Weekly data is available beginning in June 2025 onward. Historical data is available in three month chunks from January 2020 â June 2025. Each article is included as a row in the data with the following properties."},{type:"text",value:'After filtering out generic strings from the data (e.g., "Weekend Report"). We then used the <a href=https://www.geeksforgeeks.org/machine-learning/overview-of-roberta-model/>RoBERTa-base model</a> to assign embeddings to each article title, and employed these embeddings to cluster the output using <a href=https://www.geeksforgeeks.org/machine-learning/hdbscan/>HDBSCAN</a>. The clusters were labelled using an LLM aimed at creating an umbrella cluster phrase from the individual article titles in the same cluster. Subsequently, we asked two teams of subject matter experts to manually label the events with the 13 overarching (non-exclusive) themes listed below. This created a sample of roughly 8,000 theme-labelled news articles, which were used to train a classifier that subsequently applied the overarching theme labels to all other news articles.'},{type:"text",value:"To capture a publicationâs political lean, we created an average lean by using <a href=https://ground.news/>Ground Newsâ</a> media bias rating, which aggregates leans from <a href=https://www.adfontesmedia.com/ap-bias-and-reliability/>Ad Fontes Media</a>, <a href=ââhttps://www.allsides.com/news-source/associated-press-media-bias>All Sides</a>, and <a href=https://mediabiasfactcheck.com/associated-press/>Media Bias/Fact Check</a>, and <a href=https://search.mediacloud.org/directory>Media Cloudâs collections of publications</a> tweeted by voters by political lean and tweeted by followers of politicians by political lean. Each publication was assigned a value for each of the first 3 columns above. For example, CNNâs media bias rating from Ground News was âLean leftâ (-1), CNN was tweeted evenly by Republican/Democratic voters in 2018 (0), and CNN was tweeted somewhat more by followers of liberal politicians in 2019 (-1)."},{type:"text",value:"Those values were then summed and averaged, giving CNN an average value of -0.67. That average value was then mapped to the lean ranges seen below and are the political leans that we use."}],wa=[{term:"transgender",query:"transgender"},{term:"trans",query:'"trans man" OR "trans men" OR "trans woman" OR "trans women" OR "trans person" OR "trans people" OR "trans individual" OR "trans community"'},{term:"genderfluid",query:'"gender-fluid" OR genderfluid OR "gender fluid"'},{term:"gender non conforming",query:'"gender non-conforming" OR "gender non conforming" OR "gender nonconforming"'},{term:"gender ex